import RegisterBg from './images/register-bg.jpg';
import LoginBg from './images/login-bg.jpg';
import HeaderLogo from './images/header-logo.png';

//Icon
import ICFacebook from './icon/header-logo.png';
import ICTwitter from './icon/header-logo.png';
import ICInstagram from './icon/header-logo.png';
import ICGithub from './icon/header-logo.png';
import ICLinkedin from './icon/header-logo.png';


export {RegisterBg, LoginBg, HeaderLogo}
